DROP PROCEDURE IF EXISTS `sp_procesar_informacion`;
DELIMITER //
CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_procesar_informacion`(IN `userid` INT)
BEGIN
	-- Empezamos el proceso de enviar los datos de az_medicion_temporal a las respectivas
	-- tablas reales.... para su posterior procesamiento.
	DECLARE finished INTEGER DEFAULT 0;	
	DECLARE caiid INT;
	DECLARE caiid_actual INT;
	DECLARE medicionid INT;
	DECLARE loteid INT;
	DECLARE bloqueid INT;
	DECLARE municipioid INT;
	DECLARE estadoid INT;
   DECLARE error INT;
	
	-- Variables del cursor.
	DECLARE xcod_empresa VARCHAR(8);
	DECLARE xunidad VARCHAR(10);
	DECLARE xlote VARCHAR(5);
	DECLARE xbloque VARCHAR(5);
	DECLARE xcampo VARCHAR(20);
	DECLARE xarea DECIMAL(10,2);
	DECLARE xarea_guard DECIMAL(10,2);
	DECLARE xest_actual VARCHAR(50);
	DECLARE xuso_actual VARCHAR(100);
	DECLARE xuso_propuesto VARCHAR(100);
	DECLARE xmunicipio VARCHAR(80);
	
	-- Cursor que recorre la data temporal completa
	DECLARE main_cursor CURSOR FOR SELECT mt.cod_empresa,mt.unidad,mt.lote,mt.bloque,mt.campo,mt.area,
													  mt.area_guard,mt.est_actual,mt.uso_actual,mt.uso_propue,mt.municipio,
													  ( SELECT az_cai.id 
													   FROM az_unidad 
														INNER JOIN az_cai ON az_cai.id = az_unidad.cai_id 
														WHERE az_unidad.codigo = mt.unidad AND az_cai.codigo = mt.cod_empresa LIMIT 1,1) as caiid
											 FROM az_medicion_temporal mt
                                  WHERE mt.user_id = userid
											 ORDER BY mt.cod_empresa, mt.unidad;
											 
	DECLARE CONTINUE HANDLER FOR NOT FOUND SET finished = 1;
	
	-- Limpiando un poco de basura de la importacion
	DELETE FROM az_medicion_temporal WHERE cod_empresa is null;
	
	SET autocommit=0;
    SET error = 0;
	
	OPEN main_cursor;	
		cai_loop: LOOP
			-- Recojo los valores del cursort
			FETCH main_cursor INTO xcod_empresa,xunidad,xlote,xbloque,xcampo,xarea,xarea_guard,xest_actual,xuso_actual,xuso_propuesto,xmunicipio, caiid;
			
			IF caiid IS NOT NULL THEN
				IF caiid <> caiid_actual THEN
					SELECT LAST_INSERT_ID() INTO medicionid; 

					SET caiid_actual = caiid;
				END IF;
						
				-- Insertando el lote. (si no existe).
				IF NOT EXISTS ( SELECT codigo FROM az_medicion_lote WHERE codigo = xlote AND medicion_id = medicionid ) THEN
					SELECT LAST_INSERT_ID() INTO loteid;
				END IF;
				
				-- Insertando el bloque. (si no existe).
				IF NOT EXISTS ( SELECT codigo FROM az_medicion_bloque WHERE codigo = xbloque AND lote_id = loteid ) THEN
					SELECT LAST_INSERT_ID() INTO bloqueid;
				END IF;
				
				SELECT id INTO municipioid FROM az_municipio WHERE nombre = xmunicipio;
				SELECT id INTO estadoid FROM az_estado_campo WHERE nombre = xest_actual;
				
				IF municipioid IS NULL THEN
					VALUES('No se encontro un municipio con nombre "'+xmunicipio+'" en el sistema', CURRENT_TIMESTAMP(), userid);
				END IF;
				
				IF estadoid IS NULL THEN
					VALUES('No se encontro un estado de campo con nombre "'+xest_actual+'" en el sistema', CURRENT_TIMESTAMP(), userid);
				END IF;
				
				-- Insertando el campo.
				VALUES(xcampo, xarea, xuso_actual, xuso_propuesto, xarea_guard, bloqueid, municipio_id, estadoid);

				-- Si llegaste al final salgo	
				IF finished = 1 THEN
					LEAVE cai_loop;
				END IF; 
			ELSE 
				-- El CAI no existe.. que hacer ? 
				SET error = 1;
				ROLLBACK;
             -- CLOSE main_cursor; -- Cierro el cursor
             LEAVE cai_loop;    -- Salgo del ciclo iniciado para ese cursor.
			END IF;
			
		END LOOP cai_loop; 
	CLOSE main_cursor;  
	
	-- Si no hubo errores..... entonces commit a todo lo que hice ahora.
	IF error = 0 THEN
		COMMIT;
	ELSE 
			
		 SELECT mt.cod_empresa,mt.unidad,mt.lote,mt.bloque,mt.campo,mt.area,
	       mt.area_guard,mt.est_actual,mt.uso_actual,mt.uso_propue,mt.municipio, 
	       ( SELECT az_cai.id 
			   FROM az_unidad 
				INNER JOIN az_cai ON az_cai.id = az_unidad.cai_id 
				WHERE az_unidad.codigo = mt.unidad AND az_cai.codigo = mt.cod_empresa LIMIT 1,1) as cai_id
			 /*( SELECT az_unidad.id 
			   FROM az_unidad 
				INNER JOIN az_cai ON az_cai.id = az_unidad.cai_id 
				WHERE az_unidad.codigo = mt.unidad AND az_cai.codigo = mt.cod_empresa LIMIT 1,1) as unidad_id*/
		 FROM az_medicion_temporal mt
		 WHERE mt.user_id = userid -- AND (unidad_id IS NULL OR cai_id IS NULL)
	    ORDER BY mt.cod_empresa, mt.unidad;
    END IF;
	
	-- Eliminamos la informacion que se acaba de procesar.
	-- DELETE FROM az_medicion_temporal WHERE user_id = userid;
END//
DELIMITER ;

